import logo from "./logo.svg";
import "./App.css";
import MainPage from "./components/mainpage";
import { LiquidSwipe } from "./components/liquidswipe.js";
function App() {
  var components = [];
  components.push(<MainPage />);
  return (
    <div className="App">
      <LiquidSwipe components={components} colors={"#871003"} />
    </div>
  );
}

export default App;
